import React from "react";
import "./Jumbotron.css";

const Jumbotron = () => (
	<header className = "header">
		<h1>Pokemon Clicky Game!</h1>
		<h2>Click a Pokemon to earn a point, but don't click on the same once more than once! Catch all 12 Pokemon, and you win!</h2>
	</header>
);
export default Jumbotron;
